import Colors from '../../styles/Colors';
import {
  makeStyles,
  createStyles,
  Theme,
  withStyles,
} from '@material-ui/core/styles';

const Styles = makeStyles((theme: Theme) =>
  createStyles({
    carouselStyles: {
      height: theme.spacing(68),
      overflow: 'hidden',
    },
    carouselImages: {
      width: '100%',
      height: '100%',
    },
    paperImg: {
      minWidth: 275,
      '& img': {
        width: '100%',
        height: '100%',
      },
    },
  })
);

export default Styles;
